import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './section3.css'

function Section3() {
  const [data, setData] = useState([]);
  const [isUpdating, setIsUpdating] = useState(false);

  const fetchData = async () => {
    try {
      setIsUpdating(true);

      const response = await axios.get('http://127.0.0.1:8000/votes');

      if (Array.isArray(response.data) && response.data.length > 0) {
        setData(response.data);
      } else {
        // Handle the case when no valid data is received
        console.error('No valid data received:', response.data);
        setData([]);
      }

      setIsUpdating(false);
    } catch (error) {
      console.error('Error fetching data:', error);
      setIsUpdating(false);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  const formatBirthday = (dateString) => {
    if (!dateString) {
      return 'N/A';
    }

    const date = new Date(dateString);
    const options = { year: 'numeric', month: 'long', day: 'numeric', hour: '2-digit', minute: '2-digit', second: '2-digit' };
    return date.toLocaleDateString(undefined, options);
  };

  // Define a mapping between display names and API keys
  const columnMappings = {
    'Prénom': 'first_name',
    'Nom de famille': 'last_name',
    'Sexe': 'gender',
    'Taille(cm)': 'size',
    'Poids (kg)': 'weight',
    'Birthday': 'birthday'
  };

  const columns = Object.keys(columnMappings);

  const handleUpdateData = () => {
    fetchData();
  };

  const renderTable = () => {
    if (data.length === 0) {
      return null;
    }

    return (
      <div>
        <button onClick={handleUpdateData} disabled={isUpdating}>
          {isUpdating ? 'Updating...' : 'Mettre à jour'}
        </button>
        <table>
          <thead>
            <tr>
              {columns.map((column, index) => (
                <th key={index}>{column}</th>
              ))}
               <th>First Name</th>
              <th>Last Name</th>
              <th>Gender</th>
              <th>Size</th>
              <th>Weight</th>
              <th>Birthday</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {data.map((item, rowIndex) => (
              <tr key={rowIndex}>
                {columns.map((column, columnIndex) => (
                  <td key={columnIndex}>
                    {columnMappings[column] === 'birthday' ? formatBirthday(item[columnMappings[column]]) : item[columnMappings[column]] || 'N/A'}
                  </td>
                ))}
              </tr>
            ))}
            {votes.map((vote) => (
              <tr key={vote.id}>
              <td>{vote.first_name}</td>
              <td>{vote.last_name}</td>
              <td>{vote.gender}</td>
              <td>{vote.size}</td>
              <td>{vote.weight}</td>
              <td>{vote.birthday}</td>
            <td>
              <button onClick={() => handleEditClick(vote)}>Edit</button>
              </td>
        </tr>
    ))}
          </tbody>
        </table>
      </div>

    );
  };

  return (
    <div className="section3">
      <h2>Section 3</h2>
      {data.length > 0 ? (
        renderTable()
      ) : (
        <p>No valid data available.</p>
      )}
    </div>
  );
}

export default Section3;
